def compute_min_k(N):
    if not is_prime(N):
        return -1
    # Now, N is a prime number
    # We need to find the minimal k such that N^k â‰¡ 1 mod (N-1)
    # Since N and N-1 are coprime, by Fermat's little theorem, k = N-1 is a solution
    # But we need the minimal k that divides N-1
    # So we factorize N-1 and check the minimal k
    factors = factorize(N - 1)
