int modExp(int base, int exp, int mod) {
    int result = 1;
    base = base % mod;
    while (exp > 0) {
        if (exp % 2 == 1)
            result = (result * base) % mod;
        exp = exp >> 1;
        base = (base * base) % mod;
    }
    return result;
}

bool isIdentity(int N, int k, vector<int>& memo) {
    for (int a = 1; a < N; ++a) {
        int x = a;
        for (int i = 0; i < k; ++i) {
            if (memo[x] != -1) {
                x = memo[x];
            } else {
                x = modExp(x, N, N);
            }
            if (x == a) break; // Short-circuit if already identity
        }
        if (x != a) return false;
    }
    return true;
}

